import React, { Suspense } from 'react';
import logo from './layout/logo.svg';
import './App.css';
import ResponsiveAppBar from './ResponsiveAppBar';
import {
  BrowserRouter,
  Navigate,
  Route,
  Routes,
  useLocation,
} from 'react-router-dom';

function App() {
  return (
    <Suspense fallback="...loading app">
      <BrowserRouter>
        <div className="App">
          <ResponsiveAppBar />
          <header className="App-header">
            <Routes>
              <Route
                path={ROUTE_REGISTER}
                element={
                  <RequireAuth>
                    <Register />
                  </RequireAuth>
                }
              />
            </Routes>
            <p>
              Edit <code>src/App.tsx</code> and save to reload.
            </p>
            <a
              className="App-link"
              href="https://reactjs.org"
              target="_blank"
              rel="noopener noreferrer"
            >
              Hello there!
            </a>
          </header>
        </div>
      </BrowserRouter>
    </Suspense>
  );
}

export default App;
